import React, { Component } from 'react';

class Login extends Component {

    render() {
        return (
            <div>
            		<div className="row">
            			<div className="col-md-4 offset-4">
            				<h3 className="text-center">LOGIN</h3>
                            아이디 : <input type="text" placeholder="ID" id="mid" name="mid" className="form-control"/>
                            비밀번호 : <input type="password" placeholder="Password" id="mpassword" name="mpassword" className="form-control"/>
                            <div className="text-center">
                                <input  type="submit" value="로그인"  className="btn btn-primary my-3"/>
                            </div>
            		</div>
            	</div>
            </div>
        );
    }
}
export default Login;
